    false,nt"url": null,nt"notes": "<p>The National Drug File - Reference Terminology
    (NDF-RT) is produced by the U.S. Department of Veterans Affairs, Veterans Health
    Administration (VHA). NDF-RT is an extension of the VHA National Drug File (NDF).
    It organizes the drug list into a formal representation. NDF-RT Reference Terminology
    API provides clinical information about medications, including therapeutic intent,
    mechanism of action, physiologic effect and drug-drug interactions. Two NDF-RT APIs
    (SOAP/WSDL and RESTful) are available for retrieving NDF-RT data.</p>n",nt"license_title":
